// Home.tsx
import React, {useState} from 'react';
import About from './About';
import Main from './Main';
import { render } from '@testing-library/react';

function Home() {
    const [currentPage, setPage] = useState("");

    const renderPage = () => {
        switch(currentPage){
            case "about":
                return <About />;
            case "main":
                return <Main />;
            default:
               return <>
                    <button onClick={() => setPage("main")}>メイン</button>
                </>
        }
    }

    return (
        <>
            {renderPage()}
        </>
    );
}

export default Home;
